import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import logo from '../assets/images/logo.png';
import InputGroup from "react-bootstrap/InputGroup";

function AppHeader() {
  return (
    <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand href="#home">


          <img src={logo} alt="GIS" style={{ height: '50px'}} />

        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home" style={{textAlign: "center"}}>HOME</Nav.Link>
            <Nav.Link href="#about" style={{textAlign: "center"}}>ABOUT</Nav.Link>
            <Nav.Link href="#about" style={{textAlign: "center"}}>MISSION</Nav.Link>
            <Nav.Link href="#services" style={{textAlign: "center"}}>SERVICES</Nav.Link>
            <Nav.Link href="#blog" style={{textAlign: "center"}}>BLOG</Nav.Link>
            <div style={{marginRight: '200px'}}></div>
            <Button variant="primary" style={{textAlign: "center"}}>SIGN IN</Button>{' '}
            <Form><Form.Check type="switch" id="custom-switch" style={{marginLeft: "20px", marginTop: '10px'}}
                              label="üåó"/></Form>
          </Nav>
          <div className="d-flex justify-content-center">
            <InputGroup className="mb-3" style={{width: '300px'}}>
              <Form.Control
                  placeholder="Search"
                  aria-describedby="basic-addon2"
              />
              <InputGroup.Text id="basic-addon2">üîç</InputGroup.Text>
            </InputGroup>
          </div>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default AppHeader;
